import Layout1 from "../../layouts/layout1";


class profileUser extends Component{
    render(){
        return (
            <Layout1>
                <div className="container" style={{backgroundColor:'white'}}>
                    <div>
                        <img src='/images/proUser.jpg' />
                    </div>

                </div>
            </Layout1>
        )
    }
}

export default profileUser
